import React from 'react';

export default class Form extends React.Component {
  constructor(props) {
    super(props);

    this.state = { origin: ''};
  }


  handleInputChange = e => {
    this.setState({
      [e.target.name]: e.target.value,
    });
  };











  render() {
      return (
        <form>
          <h1>Carbon Calculator</h1>
          <p>From</p>
          <input
            type="text"
            name="origin"

          />
          <p>To</p>
          <input
            type="text"
          />
        </form>
      );
    }
  }
